package Casting;

public class Fabonic {

	
		// TODO Auto-generated method stub
		
			public static void main(String[] args){
			int a=0,b=1,c=a+b,n=10;
			System.out.println("Print a,b"+a+b);
			for(int i=1; i<n;i++){
			a=b;
			b=c;
			c=a+b;
			System.out.println("Fabonic Series"+c);
			}}}

	


